import logo from './logo.svg';
import './App.css';
import { useState } from 'react';

function App() {

  const [cell1, setCell1] = useState("empty");
  const [cell2, setCell2] = useState("empty");
  const [cell3, setCell3] = useState("empty");
  const [cell4, setCell4] = useState("empty");
  const [cell5, setCell5] = useState("empty");
  const [cell6, setCell6] = useState("empty");
  const [cell7, setCell7] = useState("empty");
  const [cell8, setCell8] = useState("empty");
  const [cell9, setCell9] = useState("empty");


  const handleCell = (cell, setCell) => {
    if (cell == "empty") {
      setCell("full");
      console.log("Cell 1 is now occupied!");
    } else {
      alert("This cell has already been occupied!");
    }
  }

  return (
    <div className='App'>
      <header className="App-header">
        <h1>Tic-Tac-Toe Game</h1>
      </header>
      <div>Sina</div>
      <table>
        <tbody>
          <tr>
            <td>
              <input type="checkbox" onChange={() => handleCell(cell1, setCell1)}></input>
              {cell1}
            </td>
            <td><input type="checkbox" onChange={() => handleCell(cell2, setCell2)}></input></td>
            <td><input type="checkbox"></input></td>
          </tr>

          <tr>
            <td><input type="checkbox"></input></td>
            <td><input type="checkbox"></input></td>
            <td><input type="checkbox"></input></td>
          </tr>

          <tr>
            <td><input type="checkbox"></input></td>
            <td><input type="checkbox"></input></td>
            <td><input type="checkbox"></input></td>
          </tr>
        </tbody>
      </table>
    </div>
  );
}

export default App;
